import React from 'react';
import './assets/HomeVistaEvento.css'

const HomeVistaEvento = () => {
  return (
    <div>
        {/*vista de home */}
        <p>Home Vista</p>

        <img src="https://static.independent.co.uk/2022/08/25/16/d863a74f17c81227429b82214a3bc942Y29udGVudHNlYXJjaGFwaSwxNjYxNTI0Mjcz-2.68444621.jpg?quality=75&width=320&crop=3%3A2%2Csmart&auto=webp 320w, https://static.independent.co.uk/2022/08/25/16/d863a74f17c81227429b82214a3bc942Y29udGVudHNlYXJjaGFwaSwxNjYxNTI0Mjcz-2.68444621.jpg?quality=75&width=640&crop=3%3A2%2Csmart&auto=webp 640w, https://static.independent.co.uk/2022/08/25/16/d863a74f17c81227429b82214a3bc942Y29udGVudHNlYXJjaGFwaSwxNjYxNTI0Mjcz-2.68444621.jpg?quality=75&width=990&crop=3%3A2%2Csmart&auto=webp 990w" alt="" />
    </div>
  );
};

export default HomeVistaEvento;
